import './App.css';
import React, { useState } from 'react';



function App() {

  const [file, setFile] = useState()

  function handleChange(event){
    setFile(event.target.files[0])
  }

  return (
    <div className="App">
      <form>
        <h1>
          React File Upload
        </h1>
        <input type="file" />
        <button type="submit">Upload</button>
      </form>
    </div>
  );
}

export default App;
